import com.example.coolonaryapp.databinding.ActivityAllHomeBinding

class AllHomeActivity : AppCompatActivity() {

    private lateinit var binding: ActivityAllHomeBinding
    override fun onCreate(savedInstanceState: Bundle?) {
        super.onCreate(savedInstanceState)
        binding = ActivityAllHomeBinding.inflate(layoutInflater)
        initiateRecyclerView()

        binding.icBack.setOnClickListener {
            intent = Intent(this@AllHomeActivity, MainActivity::class.java)
            startActivity(intent)
            finish()
        }
        setContentView(binding.root)
    }

    fun initiateRecyclerView() {
