            ), AllMakanan(
                image = "data:image/jpeg;base64,",
                name = "donat",
                description = "deskripsi 2"
            )
        )

        val adapterMakanan = AdapterAllMakanan(listAllMakanan)

        binding.recyclerViewAllMakanan.apply {
            binding.recyclerViewAllMakanan.layoutManager =
                GridLayoutManager(this@AllHomeActivity, 2)
            adapter = adapterMakanan
        }
